import logo from './logo.svg';
import './App.css';
import { Button } from 'reactstrap';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Row>
            <Col xs="6"><h1> Time update </h1></Col>
            <Col xs="6"> <h2> Current time is: { new Date().toLocaleTimeString()} </h2></Col>
        </Row>

      </div>
    );
  }
}

export default App;
